import ReactDOM from 'react-dom'

const timeNow = new Date().toLocaleTimeString()


ReactDOM.render(
    <>
    const ref = ()=>{
        setstate({timeNow})
    }
    const [state, setstate] = useState({
        timeNow
        })
    <h1>Time : {timeNow} </h1>
    <button onClick={ref}></button>
    </>,

    document.getElementById('root')
)
